import {TextInput} from "react-native-web";
import {useState} from "react";

export default function NInput(props) {
    const [n, setN] = useState();
    return (
        <TextInput
            keyboardType = "numeric"
            onChangeText = {(text)=> setN(text)}
        />
    )
}
